def plotembedding(vecprop,p) :
    '''
    This function allows us to represent the clusters on 2D graphs.
    Input vecprop : The list of retained eigenvectors. (2,3 or 4 eigenvectors).
    Input p : The clustering. Vector of size equal to the number of species in which each species is associated with its cluster.
    '''
    coord=[]
    coord.append(vecprop[0,:])
    coord.append(vecprop[1,:])
    
    if len(vecprop)>2:
        coord.append(vecprop[2,:])
    
    if len(vecprop)==4 :
        coord.append(vecprop[3,:])
    
    dicoCoul={0:'r',1:'b',2:'y',3:'c',4:'k',5:'m',6:'g',7:'c',8:'springgreen',9:'brown'}
    listCoul = []
    for i in range(len(p)):
        listCoul.append(dicoCoul[p[i]])
    scatter(coord[0],coord[1],color=listCoul) 
    xlabel('Component 1')
    ylabel('Component 2')
    title('GMM clustering with 2 eigenvectors')
    show()
    
    if len(vecprop)>2 :
        scatter(coord[0],coord[2],color=listCoul) 
        xlabel('Component 1')
        ylabel('Component 3')
        title('GMM clustering with 2 eigenvectors')
        show()
        scatter(coord[1],coord[2],color=listCoul) 
        xlabel('Component 2')
        ylabel('Component 3')
        title('GMM clustering with 2 eigenvectors')
        show()
    
    if len(vecprop)==4 :
        scatter(coord[0],coord[3],color=listCoul) 
        xlabel('Component 1')
        ylabel('Component 4')
        title('GMM clustering with 2 eigenvectors')
        show()
        scatter(coord[1],coord[3],color=listCoul) 
        xlabel('Component 2')
        ylabel('Component 4')
        title('GMM clustering with 2 eigenvectors')
        show()
        scatter(coord[2],coord[3],color=listCoul) 
        xlabel('Component 3')
        ylabel('Component 4')
        title('GMM clustering with 2 eigenvectors')
        show()


def scaledimage(W):
    '''
    Graphical representation of the similarity matrix.
    '''
    (N, M) = W.shape 
    fig,ax=plt.subplots()
    exts = (0, M, 0, N)
    ax.imshow(W, interpolation='nearest', cmap=cm.autumn_r, extent=exts)
    cbar = fig.colorbar(ax.imshow(W, interpolation='nearest', cmap=cm.autumn_r, extent=exts), ticks=[0,1])
    cbar.ax.set_yticklabels(['0','1'])
    ax.xaxis.set_major_locator(mt.NullLocator())
    ax.yaxis.set_major_locator(mt.NullLocator())
    return ax


def Lap_eigen_rw(w) :
    '''
    This function returns the normalized Laplacian associated with the similarity matrix.
    Input : The similarity matrix
    Output : The normalized Laplacian
    '''
    d=np.zeros((w.shape[0],w.shape[0]))
    for i in range(w.shape[0]) :
        for j in range(w.shape[0]) :
            d[i,i]=d[i,i]+w[i,j]        # d = matrix of degrees
    return(dot(np.linalg.inv(d),d-w))
    

